import React, { Component } from 'react';
import Avatar from '@mui/material/Avatar';
import Button from '@mui/material/Button';

function UserProfile({ user }) {
    return (
      <div>
        <Avatar alt={user.name} src={user.avatarUrl} />
        <h2>{user.name}</h2>
        <p>{user.bio}</p>
      </div>
    );
}

export default UserProfile;
